import React from 'react'
import NavbarHome from './NavbarHome'
import TopProfile from './TopProfile'
import BottomProfile from './BottomProfile'
import './UserProfile.css'
import {useState,useEffect} from 'react'
import axios from 'axios'
export const UserProfile = () => {
  const [profileInfo,setprofileinfo]=useState({});
  const currentid="61235583a92c2fbafca49964"
  let profileData;
  useEffect(()=>{
    const fetchProfile = async() =>
    {
      try
      {
        const res = await axios.get('user/'+currentid)
         profileData = res.data;
      }
      catch(err)
      {
        console.log(err.message);
      }
    }
    fetchProfile();
  },[])
  
  const topProfile = [{
    userName : profileData.userName,
    friends :  profileData.friends,
    postCount : profileData.posts.length,
    photo : profileData.profilepic
  }]
  
  const bottomProfile = [{
    posts:profileData.posts
  }]
  return (
    <>
      <NavbarHome />
      <div className="userProfileInfo">
        <TopProfile topProfile={topProfile} />
        <BottomProfile bottomProfile={bottomProfile} />
      </div>
    </>
  )
}
